import React, { useState } from "react";
import "./User.css";

const User = () => {
  const [admins, setAdmins] = useState([
    { id: 1, name: "John Doe", role: "Super Admin", lastLogin: "2025-03-29", status: "Active" },
    { id: 2, name: "Jane Smith", role: "Admin", lastLogin: "2025-03-27", status: "Disabled" },
    { id: 3, name: "David Johnson", role: "Editor", lastLogin: "2025-03-25", status: "Active" },
  ]);

  const [newAdmin, setNewAdmin] = useState({ name: "", role: "Admin", status: "Active" });
  const [editingAdmin, setEditingAdmin] = useState(null);

  // Handle input changes for adding new admin
  const handleInputChange = (e) => {
    setNewAdmin({ ...newAdmin, [e.target.name]: e.target.value });
  };

  // Add new admin
  const addAdmin = () => {
    if (newAdmin.name.trim() === "") return;
    setAdmins([...admins, { ...newAdmin, id: admins.length + 1, lastLogin: "Never" }]);
    setNewAdmin({ name: "", role: "Admin", status: "Active" });
  };

  // Edit admin role
  const editAdminRole = (id, newRole) => {
    setAdmins(admins.map(admin => admin.id === id ? { ...admin, role: newRole } : admin));
  };

  // Delete admin
  const deleteAdmin = (id) => {
    setAdmins(admins.filter(admin => admin.id !== id));
  };

  return (
    <div className="user-management-container">
      <h1>👤 Admin User Management</h1>

      {/* Add New Admin */}
      <div className="add-admin">
        <input
          type="text"
          name="name"
          placeholder="Enter Admin Name"
          value={newAdmin.name}
          onChange={handleInputChange}
        />
        <select name="role" value={newAdmin.role} onChange={handleInputChange}>
          <option value="Super Admin">Super Admin</option>
          <option value="Admin">Admin</option>
          <option value="Editor">Editor</option>
          <option value="Viewer">Viewer</option>
        </select>
        <button onClick={addAdmin} className="add-button">
          ➕ Add New Admin
        </button>
      </div>

      {/* Admins Table */}
      <table className="admin-table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Role</th>
            <th>Last Login</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {admins.map((admin) => (
            <tr key={admin.id}>
              <td>{admin.name}</td>
              <td>
                <select value={admin.role} onChange={(e) => editAdminRole(admin.id, e.target.value)}>
                  <option value="Super Admin">Super Admin</option>
                  <option value="Admin">Admin</option>
                  <option value="Editor">Editor</option>
                  <option value="Viewer">Viewer</option>
                </select>
              </td>
              <td>{admin.lastLogin}</td>
              <td className={admin.status === "Active" ? "status-active" : "status-disabled"}>
                {admin.status}
              </td>
              <td>
                <button className="edit-btn" onClick={() => setEditingAdmin(admin)}>
                  ✏️ Edit
                </button>
                <button className="delete-btn" onClick={() => deleteAdmin(admin.id)}>
                  ❌ Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Edit Admin Modal (if needed) */}
      {editingAdmin && (
        <div className="modal">
          <div className="modal-content">
            <h3>Edit Admin</h3>
            <input
              type="text"
              value={editingAdmin.name}
              onChange={(e) => setEditingAdmin({ ...editingAdmin, name: e.target.value })}
            />
            <button onClick={() => setEditingAdmin(null)}>Save</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default User;
